import logo from './logo.svg';
import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

import Container from '@material-ui/core/Container';

import { Home, Login, Profile } from './pages';

function App() {
  return (
    <div className="App">
      <header>

      </header>


      <Router>
      <Container maxWidth="sm">
      <Switch>
          <Route exact path="/">
            <Login />
          </Route>
          <Route path="/home">
            <Home />
          </Route>
          <Route path="/profile">
            <Profile />
          </Route>
        </Switch>
        </Container>

      </Router>

    </div>
  );
}

export default App;
